  \"Water quality issues as potential limiting factors affecting juvenile Atlantic
  salmon life stages in Maine rivers: A report to the Maine Atlantic Salmon Technical
  Advisory Committee\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:48:54.519844\",\n\t\"name\": \"water-quality-issues-as-potential-limiting-factors-affecting-juvenile-atlantic-salmon-life\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Signatories to the Maine Atlantic Salmon
  Technical Advisory Committee (TAC), in a letter to the TAC chair, requested guidance
  to resolve the issue whether water quality issues are a concern for the management
  of Atlantic salmon and worthy of future management investments. The issues of particular
  interest were acidification and endocrine disruptor chemicals, but other water quality
  issues were also to be considered. The signatories specifically requested information
  relative to the following three aspects: (a) Are water quality data and on-going
  efforts to gather more data currently available and adequate to determine if water
  quality issues are a limiting factor related to the restoration of Atlantic salmon?
  If not, please recommend an approach so the significance of the identified water
  quality issues can be properly assessed. (b) What are the relative priorities in
  the areas of water quality survey and inventory as compared with basic research
  into the impacts of the water quality factors on Atlantic salmon? (c) Identify watersheds
  with the greater and lesser probabilities of vulnerability to the water quality
  issues identified.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
